@SOne247 Our apologies for the difficulties.
If the website (https://t.co/oNUBczpsT4) isn't working, please give WestJet Vacations a call directly at 1-877-737-7001.
They are open daily from 6:00 a.m. to 10:00 p.m. MT.

@Kausj83 If you need our help, send us a direct message with the following:
● your full name;
● the six-letter reservation code;
● where you flew from and to;
● the delayed baggage reference number and bag tag numbers; and,
● the email address on the claim. https://t.co/o7MlHGdDLP

@TomKrall905 At this point, all we can do is suggest taking taxis.
The hotels are only a few minutes drive from the airport.
They are looking at holding the flight.

@TomKrall905 Our apologies for the difficulties.
The hotels guests were sent to have airport shuttles.
We're being advised guests should be taking the hotel shuttles.
